import Link from 'next/link';

const Logo = () => (
  <div className="logo">
    <Link href="/">
    <a><img src="/static/portfolio-logo.svg" /></a>
    </Link>

    <style jsx>{`
      .logo img {
        display: block;
        width: 400px;
        margin-left: 20px;
        fill: #FFF;
      }
      @media (max-width: 600px) {
        .logo {
          display: inline-block;
        }
      }
    `}</style>
  </div>
);

export default Logo;
